                y = ApproxUtil<Pow2.N16>.Pade(lambda - 160, pade_plus_160_192);
            }
            else if (lambda <= 256) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 192, pade_plus_192_256);
            }
            else if (lambda <= 384) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 256, pade_plus_256_384);
            }
            else if (lambda <= 512) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 384, pade_plus_384_512);
            }
            else if (lambda <= 768) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 512, pade_plus_512_768);
            }
            else if (lambda <= 1024) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 768, pade_plus_768_1024);
            }
            else if (lambda <= 1536) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 1024, pade_plus_1024_1536);
            }
            else if (lambda <= 2048) {
                y = ApproxUtil<Pow2.N16>.Pade(lambda - 1536, pade_plus_1536_2048);
            }
            else {
                throw new ArithmeticException($"Extremely large {nameof(lambda)}");
            }

            return y;
        }

        private static MultiPrecision<Pow2.N16> NegativeValue(MultiPrecision<Pow2.N16> lambda) {
            if (lambda.Sign == Sign.Plus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            MultiPrecision<Plus1<Pow2.N16>> a = AMinus(lambda).Convert<Plus1<Pow2.N16>>();
            MultiPrecision<Plus1<Pow2.N16>> sigma = Sigma<Plus1<Pow2.N16>>.Value(lambda.Convert<Plus1<Pow2.N16>>());

            MultiPrecision<Plus1<Pow2.N16>> scale = c / (MultiPrecision<Plus1<Pow2.N16>>.Sqrt(sigma) * MultiPrecision<Plus1<Pow2.N16>>.Exp(sigma));
            MultiPrecision<Pow2.N16> y = (a * scale).Convert<Pow2.N16>();

            return y;
        }

        public static MultiPrecision<Pow2.N16> AMinus(MultiPrecision<Pow2.N16> lambda) {
            if (lambda.Sign == Sign.Plus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            MultiPrecision<Pow2.N16> y;
            if (lambda >= -0.5) {
                y = ApproxUtil<Pow2.N16>.Pade(0.5 + lambda, pade_minus_0_0p5);
            }
            else if (lambda >= -1) {
                y = ApproxUtil<Pow2.N16>.Pade(1 + lambda, pade_minus_0p5_1);
            }
            else if (lambda >= -1.5) {
                y = ApproxUtil<Pow2.N16>.Pade(1.5 + lambda, pade_minus_1_1p5);
            }
            else if (lambda >= -2) {
                y = ApproxUtil<Pow2.N16>.Pade(2 + lambda, pade_minus_1p5_2);
            }
            else if (lambda >= -2.5) {
                y = ApproxUtil<Pow2.N16>.Pade(2.5 + lambda, pade_minus_2_2p5);
            }
            else if (lambda >= -3) {
                y = ApproxUtil<Pow2.N16>.Pade(3 + lambda, pade_minus_2p5_3);
            }
            else if (lambda >= -3.5) {
                y = ApproxUtil<Pow2.N16>.Pade(3.5 + lambda, pade_minus_3_3p5);
            }
            else if (lambda >= -4) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 3.5, pade_minus_3p5_4);
            }
            else if (lambda >= -4.5) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 4, pade_minus_4_4p5);
            }
            else if (lambda >= -5) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 4.5, pade_minus_4p5_5);
            }
            else if (lambda >= -5.5) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 5, pade_minus_5_5p5);
            }
            else if (lambda >= -6) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 5.5, pade_minus_5p5_6);
            }
            else if (lambda >= -6.5) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 6, pade_minus_6_6p5);
            }
            else if (lambda >= -7) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 6.5, pade_minus_6p5_7);
            }
            else if (lambda >= -7.5) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 7, pade_minus_7_7p5);
            }
            else if (lambda >= -8) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 7.5, pade_minus_7p5_8);
            }
            else if (lambda >= -9) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 8, pade_minus_8_9);
            }
            else if (lambda >= -10) {
                y = ApproxUtil<Pow2.N16>.Pade(-lambda - 9, pade_minus_9_10);
            }
            else {
                y = ApproxUtil<Pow2.N16>.Poly(1 / Sigma<Pow2.N16>.Value(lambda), asymptotic_minus);
            }

            return y;
        }
    }
